import React from "react";
import User from './images/u.png'
import Ups from './images/ups.png'

function App() {
  return (
    <div className="bg-white">
      <nav className="bg-white position-fixed">
      <div>
        <img src={Ups}/>
      </div>
        <div  className="flex h-14 justify-end">
          <img src={User} className="mt-4 mr-40 bg-yellow-400  bg-auto rounded-full"/>
        </div>  
        <p>Hello</p>
      </nav>
    </div>
  );
}

export default App;
